import React from "react";
import './CSS/Geomap.css';
import { GoogleMap, LoadScript } from '@react-google-maps/api';

const containerStyle = {
  width: '50%', // Justeret til 100% for at fylde containeren
  height: '50%' // Justeret til 100% for at fylde containeren
};

const center = {
  lat: -3.745,
  lng: -38.523
};

function Geomap() {
  return (
    <div className="geomap-screen"> {/* Tilf√∏jet denne div med klassen */}
      <LoadScript
        googleMapsApiKey="AIzaSyDciRrRmBl9mb-k6mm9vg68k7hJwoIt1TQ">
        <GoogleMap
          mapContainerStyle={containerStyle}
          center={center}
          zoom={10}
        >
        </GoogleMap>
      </LoadScript>
    </div>
  )
}

export default React.memo(Geomap);
